import { Component, OnInit } from "@angular/core";
import { async } from "@angular/core/testing";
import { FormControl, FormGroup, Validators } from "@angular/forms";
import { Router } from "@angular/router";
import { GlobelServiceService } from "../globel-service.service";

@Component({
  selector: "app-login",
  templateUrl: "./login.component.html",
  styleUrls: ["./login.component.scss"],
})
export class LoginComponent implements OnInit {
  form: FormGroup;
  constructor(public serive: GlobelServiceService, public router: Router) {}
  data;
  dummyData = [];
  ngOnInit(): void {
    this.form = new FormGroup({
      username: new FormControl("", Validators.required),
      password: new FormControl("", Validators.required),
    });

    if (this.serive.isLogin()) {
      this.router.navigate(["employeeForm"]);
    }
    this.Data();
  }

  async Data() {
    await this.serive.dummyAPIData().subscribe((x) => {
      this.data = x;
      console.log(this.data);
    });
  }

  signIn() {
    if (!this.form.value.username && !this.form.value.password) {
      alert("Username and password required");
    }
    for (let i = 0; i < this.serive.users.length; i++) {
      if (
        this.form.value.username == this.serive.users[i].username &&
        this.form.value.password == this.serive.users[i].password
      ) {
        this.serive.setLocalStorage("activeUser", this.serive.users[i]);

        this.serive.user = this.serive.users[i];
        this.router.navigate(["viewForm"]);
      } else {
        for (let j = 0; j < this.serive.users.length; j++) {
          if (
            ( this.form.value.username != this.serive.users[i].username &&
              this.form.value.password != this.serive.users[i].password  ) 
            
                 
           )
            {
           this.router.navigate(['viewForm'])
           break;
          }

          alert("Username and password is incorrect");
        }
      }
    }
  }
  image: string =
    "";
}
